import NavItem from './NavItem';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

const Nav = () => {
    return(
        <Router>
            <nav>
                <ul>
                    ddd
                    <Routes>
                        <Route path="/" exact element={() => <NavItem url={'/posts'} linkName={'Posts'}/>} />
                        <Route path="/" exact element={() => <NavItem url={'/contact'} linkName={'Contact'}/>} />
                        <Route path="/" exact element={() => <NavItem url={'/about'} linkName={'About'}/>} />
                    </Routes>
                    aa
                </ul>
            </nav>
        </Router>
    )
}


export default Nav;
